import React from 'react';
import './Timeline.css'; // CSS for styling

const events = [
  {
    id: 1,
    date: 'January 2024',
    description: 'Event 1 description goes here.',
  },
  {
    id: 2,
    date: 'February 2024',
    description: 'Event 2 description goes here.',
  },
  {
    id: 3,
    date: 'March 2024',
    description: 'Event 3 description goes here.',
  },
  // Add more events as needed
];

const Timeline = () => {
  const leftEvents = [];
  const rightEvents = [];

  events.forEach((event, index) => {
    if (index % 2 === 0) {
      leftEvents.push(event);
    } else {
      rightEvents.push(event);
    }
  });

  return (
    <div className="timeline">
      <div className="left-events">
        {leftEvents.map(event => (
          <div key={event.id} className="event">
            <div className="event-date">{event.date}</div>
            <div className="event-description">{event.description}</div>
          </div>
        ))}
      </div>
      <div className="right-events">
        {rightEvents.map(event => (
          <div key={event.id} className="event">
            <div className="event-date">{event.date}</div>
            <div className="event-description">{event.description}</div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Timeline;
